                ans += chr(i + 97)
                lcopy[i] -= 1
                break
        return ans * arrange(lcopy)
    first_count = [0] * 26
    for letter in s:
        first_count[ord(letter) - 97] += 1
    common = 0
    lcopy = list(first_count)
    for i in range(len(t)):
        letter = t[i]
        num = ord(letter) - 97
        if lcopy[num] > 0:
            lcopy[num] -= 1
            common += 1
        else:
            break
    found = False
    ans = ''
    for cval in range(common, -1, -1):
        if cval >= len(s):
